import { image } from "@tensorflow/tfjs-core";
import * as faceapi from "face-api.js/dist/face-api.min";
import {gsap} from "gsap/dist/gsap.min";
import Usmani from "../dist/utils/labelled images/Usmani/*.jpg";
import Ahad from "../dist/utils/labelled images/Ahad/*.jpg";
import images from "../dist/utils/labelled images/*/*.jpg";
// import ssd from "../dist/utils/models/ssd_mobilenetv1_model-weights_manifest.json";
// import faceRecog from "../dist/utils/models/face_recognition_model-weights_manifest.json";
// import faceLand from "../dist/utils/models/face_landmark_68_model-weights_manifest.json";
// console.log(ssd);
// console.log(faceapi);

const container = document.querySelector('.container');
const container2 = document.querySelector('.container2');
const container3 = document.querySelector('.container3');
const lottieSvg = document.querySelector('.lottie-svg');
const searchingFace = document.querySelector('.searching-tag');
const btn = document.querySelector('.btn');
const video = document.getElementById('videoInput')
const t1 = gsap.timeline()
const MODEL_URL = "https://justadudewhohacks.github.io/face-api.js/models/"
let loopCompleted = 0;
let animLottie;
//                                      BANNER ANIMATION
// console.log(anime());
let banner = anime({
    targets: '#usmani path',
    strokeDashoffset: [anime.setDashoffset, 0],
    easing: 'easeInOutSine',
    duration: 2500,
    delay: function(el, i) { return i * 250 },
    endDelay: 500,
    direction: 'alternate',
    loop: true,
    loopComplete: function(anim) {
        // console.log(anim)
        loopCompleted++;
        if (loopCompleted == 2) {
            // console.log(banner)
            banner.pause();
            Promise.all([
                faceapi.nets.ssdMobilenetv1.loadFromUri(MODEL_URL), //heavier/accurate version of tiny face detector
                console.log("Loaded models"),
                faceapi.nets.faceRecognitionNet.loadFromUri(MODEL_URL),
                console.log("Loaded models"),
                faceapi.nets.faceLandmark68Net.loadFromUri(MODEL_URL),
                console.log("Loaded models")
            ]).then( () => {
                console.log(t1);
                t1.to(container, {clipPath: 'polygon(100% 0, 100% 0, 100% 100%, 100% 100%)'}, '+=9')
                container.style.display = 'none';
                container2.style.display = 'flex';
                container2.style.opacity = '1';
                animLottie = bodymovin.loadAnimation( {
                    wrapper: lottieSvg,
                    animType: 'svg',
                    // initialSegment: [0,300],
                    loop: true,
                    autoplay: false,
                    path: "https://assets6.lottiefiles.com/packages/lf20_wK2ITq.json",
                    playMode: 'bounce'
                });
                animLottie.play();
                searchingFace.innerHTML = "Seaching for Face...";
                start();
                
                // searchingFace.classList.remove("searching-tag");
            }).catch((err) => {
                console.log(err);
            })
            

        }
    }
    });


// setTimeout(function(){
//     container.style.display = 'none';
//     container2.style.display = 'flex';
//     container2.style.opacity = '1';
//     animLottie = bodymovin.loadAnimation( {
//         wrapper: lottieSvg,
//         animType: 'svg',
//         // initialSegment: [0,300],
//         loop: true,
//         autoplay: false,
//         path: 'scripts/svg_face_recognition.json',
//         playMode: 'bounce'
//     });
//     animLottie.play();
//     searchingFace.innerHTML = "Seaching for Face...";
// },9000);



function start() {
    console.log('Models Loaded')
    navigator.getUserMedia(
        { video:{} },
        stream => { video.srcObject = stream;
                    // stream = videoStream;
                    console.log(stream);
        },
        err => console.error(err)
    )
    
    //video.src = '../videos/speech.mp4'
    
    recognizeFaces()
}
    


async function recognizeFaces() {

    const labeledDescriptors = await loadLabeledImages()
    console.log(labeledDescriptors)
    const faceMatcher = new faceapi.FaceMatcher(labeledDescriptors, 0.7)


    
    // faceapi.matchDimensions(canvas, displaySize)
    setInterval(async () => {
        // console.log('recog is working')
        const detections = await faceapi.detectAllFaces(video).withFaceLandmarks().withFaceDescriptors()

        // const resizedDetections = faceapi.resizeResults(detections, displaySize)
        // if (!detections.length) {
        //     searchingFace.innerHTML = `Searching for Face...`;
        // }
        const results = detections.map((d) => {
            return faceMatcher.findBestMatch(d.descriptor)
        })
        if (results.length != 0) {
            // console.log(results);
            results.forEach( (result, i) => {
                searchingFace.innerHTML = `Welcome ${result._label}`; 
                searchingFace.style.animation = 'none';
            })
            // animLottie.pause();
            dashboard();
        } 
    }, 100)
}


function loadLabeledImages() {
    // //const labels = ['Black Widow', 'Captain America', 'Hawkeye' , 'Jim Rhodes', 'Tony Stark', 'Thor', 'Captain Marvel']
   
    // // const labels = ['Ahad', 'Usmani']
    // let names = [];
    // let value;
    // let values = [];
    // var counter = 0;
    // Object.entries(images).map(item => {
    //     console.log((item[1]))
    //     names.push(item[0]);
    // });
    // Object.entries(images).forEach(item => {
    // });
    // console.log(names)

    return Promise.all(

        Object.entries(images).map(async (label)=>{
            const descriptions = []
            for(let i=1; i<=2; i++) {
                let img;
                img = await faceapi.fetchImage(label[1][i])
                const detections = await faceapi.detectSingleFace(img).withFaceLandmarks().withFaceDescriptor()
                // console.log(label + i + JSON.stringify(detections))
                descriptions.push(detections.descriptor)
            }
            console.log(label[0]+' Faces Loaded | ')
            return new faceapi.LabeledFaceDescriptors(label[0], descriptions)
        })
    )
};



function dashboard() {
    // window.location.replace("../dashboard.html");
    // const highway = new Highway.Core({
    //     transitions: {
    //         default: Fade
    //     }
    // });
    // setTimeout(function(){
    //     container2.style.display = 'none';
    // },2000);
    // container2.classList.add('hide');
    // container3.style.display = 'flex';
    // container3.style.opacity = '1';

    // console.log('Dashboarding');
};
